import React from "react";
import logoo from "../assets/mozy.png";

function NavBar() {
  return (
    <div className="Navbar">
      <div className="Left">
        <img src={logoo} />
      </div>
      <div className="right">hello</div>
    </div>
  );
}

export default NavBar;
